import batchTimePrefScore as calc

def genPresetScore():
    def setDaytimeRange(slot_daytime, st_daytime, en_daytime):
        '''
        Enter time as argument. 24 hour notation and 0.5 for xx:30 time.
        It will set those given range to 1. en_daytime to en_daytime+30min timeslot is not included.

        '''
        new_slot_daytime = [0] * 48

        if(st_daytime - int(st_daytime) > 0):
            # Handle xx:30
            index_st = int(st_daytime) * 2 + 1
        else:
            index_st = int(st_daytime) * 2

        if(en_daytime - int(en_daytime) > 0):
            # Handle xx:30
            index_en = int(en_daytime) * 2 + 1
        else:
            index_en = int(en_daytime) * 2


        new_slot_daytime = slot_daytime
        if(index_st > index_en):
            new_slot_daytime[index_st:48] = [1] * (48 - index_st)
            new_slot_daytime[0:index_en] = [1] * (index_en)
        else:
            new_slot_daytime[index_st:index_en] = [1] * (index_en - index_st)

        return new_slot_daytime


    presetDict = {};

    token = '오전';
    weekday = [1] * 7;
    daytime = [0] * 48;
    daytime = setDaytimeRange(daytime, 0, 12)
    presetDict[token] = calc.getTimeSlotScore(weekday, daytime, factor_daypropagation=0, factor_smooth=0)

    token = '새벽';
    weekday = [1] * 7;
    daytime = [0] * 48;
    daytime = setDaytimeRange(daytime, 2, 7)
    presetDict[token] = calc.getTimeSlotScore(weekday, daytime, factor_daypropagation=0, factor_smooth=0)

    token = '아침';
    weekday = [1] * 7;
    daytime = [0] * 48;
    daytime = setDaytimeRange(daytime, 7, 11)
    presetDict[token] = calc.getTimeSlotScore(weekday, daytime, factor_daypropagation=0, factor_smooth=0)

    token = '점심';
    weekday = [1] * 7;
    daytime = [0] * 48;
    daytime = setDaytimeRange(daytime, 11, 14)
    presetDict[token] = calc.getTimeSlotScore(weekday, daytime, factor_daypropagation=0, factor_smooth=0)

    token = '오후';
    weekday = [1] * 7;
    daytime = [0] * 48;
    daytime = setDaytimeRange(daytime, 12, 24)
    presetDict[token] = calc.getTimeSlotScore(weekday, daytime, factor_daypropagation=0, factor_smooth=0)

    token = '낮';
    weekday = [1] * 7;
    daytime = [0] * 48;
    daytime = setDaytimeRange(daytime, 10, 18)
    presetDict[token] = calc.getTimeSlotScore(weekday, daytime, factor_daypropagation=0, factor_smooth=0)

    token = '저녁';
    weekday = [1] * 7;
    daytime = [0] * 48;
    daytime = setDaytimeRange(daytime, 17, 22)
    presetDict[token] = calc.getTimeSlotScore(weekday, daytime, factor_daypropagation=0, factor_smooth=0)

    token = '밤';
    weekday = [1] * 7;
    daytime = [0] * 48;
    daytime = setDaytimeRange(daytime, 21, 3)
    presetDict[token] = calc.getTimeSlotScore(weekday, daytime, factor_daypropagation=0, factor_smooth=0)

    token = '주말';
    weekday = [1, 0, 0, 0, 0, 0, 1];
    daytime = [1] * 48;
    presetDict[token] = calc.getTimeSlotScore(weekday, daytime, factor_daypropagation=0, factor_smooth=0)

    token = '평일';
    weekday = [0, 1, 1, 1, 1, 1, 0];
    daytime = [1] * 48;
    presetDict[token] = calc.getTimeSlotScore(weekday, daytime, factor_daypropagation=0, factor_smooth=0)

    daytime = [1] * 48;
    for index, token in enumerate(['일요일', '월요일', '화요일', '수요일', '목요일', '금요일', '토요일']):
        weekday = [0, 0, 0, 0, 0, 0, 0];
        weekday[index] = 1;

        presetDict[token] = calc.getTimeSlotScore(weekday, daytime, factor_daypropagation=0, factor_smooth=0)

    return presetDict


def codegenPreset(presetDict):
    '''
    This code is not used on runtime. It is used to generate preset score for
    getPresetScore(token) function.

    Generated code is saved as presetCode.txt file.
    '''
    def score_local2utc(score):
        '''
        For convienece reason, I generated tokens based on local time. However the data should be stored in UTC.
        This function returns UTC based score.
        '''
        NUM_TIMESLOT = (48*7)
        utc_score = [0] * NUM_TIMESLOT
        utc_score[0:(NUM_TIMESLOT-9*2)] = score[18:NUM_TIMESLOT]
        utc_score[(NUM_TIMESLOT-9*2):NUM_TIMESLOT] = score[0:18]
        return utc_score

    code = 'presetDict={}\n'
    for key, value in presetDict.iteritems():
        code += 'presetDict[\'%s\']=['%(key) + ','.join([str(x) for x in score_local2utc(value)]) + ']\n'

    with open('presetCode.txt', 'w') as f:
        f.write(code)

def generate():
	codegenPreset(genPresetScore())

